def II(ns, one=None, /):
    if one is None:
        one = 1

    ns = iter(ns)
    for prod in ns:
        break
    else:
        return one

    for x in ns:
        prod *= x

    return prod


def iter_divisors_of(n, /, *, hints):
    r'iter_divisor(n) = [d if [d\n]]'

    p_exp_ls = tuple(factor_pint_into_prime2exp__using_hints(n, hints=hints).items())
    ps = tuple(p for p,e in p_exp_ls)
    for es in product(*(range(e+1) for p,e in p_exp_ls)):
        #print(es)
        yield II(p**e for p,e in zip(ps, es))
    pass

