def iter_factor_hints4pow_p_e_plus1(base, exp, /, *, hints4exp):
    'helper of factor(base**exp +1)'
    if not base >= 2: raise ValueError
    e2 = max_power_of_base_as_factor_of_(2, exp)
    odd = exp//2**e2
    assert odd << e2 == exp
    assert odd & 1

    base **= e2
    exp = odd
    hints = (base**d +1 for d in iter_divisors_of(exp, hints=hints4exp) if not d == exp)
    return hints



def iter_factor_hints4pow_p_e_minus1(base, exp, /, *, hints4exp):
    'helper of factor(base**exp -1)'
    if not base >= 2: raise ValueError
    hints = (base**d -1 for d in iter_divisors_of(exp, hints=hints4exp) if not d == exp)
    return hints

